import React, { useState } from 'react'

const Main = () => {

    const[contador, setContador] = useState(0);

    return(
        <main className="main">
            Main Content
                {`Main content ${contador}`}
                <button
                onClick={()=> setContador( contador + 1)}
                >
                    Click me Alicia!
                </button>
        </main>
    )
 }

 export default Main;
